- Valider votre chargement et sa destination ;
- Faire le lien avec les contrôleurs chargeurs pour passation de consignes ou informations relatives au chargement ;
- Livrer les commandes aux clients et agences ;
- Charger et décharger votre véhicule (aide aux clients) ;
- Valider les marchandises livrées ;
- Traiter les documents liés à la livraison ;
- Faire remonter les anomalies de livraison.

